import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import axios from 'axios';
import Stopwatch from '../components/Stopwatch';

export default function Second() {
    const [team, setTeam] = useState('');
    const [date, setDate] = useState('');
    const [op1, setOp1] = useState('');
    const [grade1, setGrade1] = useState('');
    const [op2, setOp2] = useState('');
    const [grade2, setGrade2] = useState('');
    const [stopwatch1, setStopwatch1] = useState(0);
    const [stopwatch2, setStopwatch2] = useState(0);
    const navigate = useNavigate();

    const handleStopwatch1Change = (stopwatch1value,stopwatch2value) => {
      setStopwatch1(stopwatch1value);
      setStopwatch2(stopwatch2value);
  };

    const handleSubmit = async(event) => {
        event.preventDefault();
        /*const stopwatch1 = value;
        if (isNaN(stopwatch1)) {
            console.error('Value must be a number');
            return;
        }*/
        axios.post('http://localhost:8070/router/add', {
            team: team,
            date: date,
            Operatorname: op1,
            Operatorgrade: grade1,
            Operationname: op2,
            Operationgrade: grade2,
            adjustedTime: stopwatch1,
            piecesPerHour: stopwatch2 
        })
        .then(response => {
            console.log(response.data);
            navigate('/First');
        })
        .catch(error => {
            console.error('There was an error!', error);
        });
    };

    return (
        <div>
            <h1>Operator details</h1>
            <form onSubmit={handleSubmit}>
                <label>Team</label>
                <input type="text" name="team" value={team} onChange={(e) => setTeam(e.target.value)} /><br/>

                <label>Date</label>
                <input type="date" name="date" value={date} onChange={(e) => setDate(e.target.value)} /><br/>
                
                <label>Operation</label>
                <input type="text" name="op1" value={op1} onChange={(e) => setOp1(e.target.value)} />
                
                <label>Grade</label>
                <input type="text" name="grade1" value={grade1} onChange={(e) => setGrade1(e.target.value)} /><br/>
                
                <label>Operator</label>
                <input type="text" name="op2" value={op2} onChange={(e) => setOp2(e.target.value)} />
                
                <label>Grade</label>
                <input type="text" name="grade2" value={grade2} onChange={(e) => setGrade2(e.target.value)} /><br/>
                
            
                <input type="submit"value="OK"
                onSubmit={()=>{
                handleSubmit();
                handleStopwatch1Change();
            }}
            />
            </form>
           <Stopwatch onStopwatchChange={handleStopwatch1Change}/>
        
           
        </div>
    );
}
